const LOGO_SRC = 'data:image/png;base64,'

interface LogoProps {
  variant?: 'header' | 'auth' | 'footer' | 'loader'
  href?: string
  className?: string
  style?: React.CSSProperties
}


export function Logo({ variant = 'header', className, style }: LogoProps) {
  const isFooter = variant === 'footer'
  const isLoader = variant === 'loader'
 

 if (isLoader) {
    return (
      <img
        src={LOGO_SRC}
        width={48}
        height={48}
        alt="Astrotattwa"
        className={className}
        style={{
          display: 'block',
          width: '48px',
          height: '48px',
          objectFit: 'contain',
          ...style,
        }}
      />
    )
  }

  return (
    <a
      href="/"
      style={{
        display: 'inline-flex',
        alignItems: 'center',
        gap: '10px',
        textDecoration: 'none',
        flexShrink: 0,
      }}
    >
      <img
        src={LOGO_SRC}
        width={38}
        height={38}
        alt="Astrotattwa logo"
        style={{
          display: 'block',
          flexShrink: 0,
          width: '38px',
          height: '38px',
          objectFit: 'contain',
        }}
      />
      <span
        style={{
          fontFamily: "'DM Sans', sans-serif",
          fontSize: isFooter ? '16px' : '18px',
          fontWeight: 600,
          letterSpacing: '-0.3px',
          color: isFooter ? 'var(--text2)' : 'var(--text)',
          lineHeight: 1,
        }}
      >
        Astrotattwa
      </span>
    </a>
  )
}
